/**
 * @param {number[]} nums
 * @param {number} x
 * @return {number}
 */
var minAbsoluteDifference = function(nums, x) {
    let minDiff = Infinity;
    for (let i = 0; i < nums.length; i++) {
        for (let j = i + x; j < nums.length; j++) {
            const diff = Math.abs(nums[i] - nums[j]);
            minDiff = Math.min(minDiff, diff);
        }
    }
    return minDiff;
};
